import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";

function Timeline() {
  useEffect(() => {
    AOS.init({ duration: 700 });
    AOS.refresh();
  }, []);
  return (
    <div className="tim-cont">
        <div className='tim-head'>Timeline Of My Life</div>
        
    </div>
  );
}

export default Timeline;
